Source.BuildSpec:
{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "ls && cd AbdulBasit/sprint_5/",
        "pip install -r requirements.txt",
        "npm install -g aws-cdk",
        "cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "AbdulBasit/sprint_5/cdk.out",
    "files": "**/*"
  }
}

{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "ls && cd AbdulBasit/sprint_5/",
        "pip install -r requirements-dev.txt",
        "python -m pytest -vv tests/"
      ]
    }
  }
}

{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "nohup /usr/local/bin/dockerd --host=unix:///var/run/docker.sock --host=tcp://127.0.0.1:2375 --storage-driver=overlay2 &",
        "timeout 15 sh -c \"until docker info; do echo .; sleep 1; done\""
      ]
    },
    "pre_build": {
      "commands": [
        "ls && cd AbdulBasit/sprint_5/pyrest",
        "docker build -t api-test-basit ."
      ]
    },
    "build": {
      "commands": [
        "docker run api-test-basit  https://2nq8trov1c.execute-api.us-west-1.amazonaws.com/prod api_test.yml"
      ]
    }
  }
}
